import React, { useState, useEffect } from "react";
import axios from "axios";
import styled from "styled-components";

// Styled Components
const Container = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 20px;
  font-family: "San Francisco", "Helvetica", "Myriad Set", sans-serif;
  background-color: #f5f5f7;
  color: #1d1d1f;
`;

const Header = styled.h1`
  font-size: 3rem;
  font-weight: bold;
  text-align: center;
  color: #007aff;
  margin-bottom: 40px;
`;

const SearchBar = styled.input`
  width: 100%;
  max-width: 600px;
  padding: 12px;
  border-radius: 25px;
  border: 1px solid #d2d2d7;
  outline: none;
  font-size: 1rem;
  margin-bottom: 20px;
  display: block;
  margin-left: auto;
  margin-right: auto;
`;

const Button = styled.button`
  display: block;
  width: 200px;
  margin: 10px auto;
  padding: 12px;
  font-size: 1rem;
  border-radius: 25px;
  border: none;
  background-color: #007aff;
  color: white;
  cursor: pointer;
  transition: 0.3s ease;
  
  &:hover {
    background-color: #005ecb;
  }
`;

const VideoList = styled.ul`
  list-style: none;
  padding: 0;
  margin-top: 30px;
`;

const VideoItem = styled.li`
  background: rgba(255, 255, 255, 0.8);
  backdrop-filter: blur(10px);
  padding: 15px;
  border-radius: 15px;
  box-shadow: 0 10px 20px rgba(0, 0, 0, 0.1);
  margin-bottom: 15px;
  transition: transform 0.3s ease;
  
  &:hover {
    transform: translateY(-5px);
  }
`;

const KeywordSection = styled.div`
  margin-top: 40px;
  padding: 20px;
  background: white;
  border-radius: 20px;
  box-shadow: 0 10px 20px rgba(0, 0, 0, 0.1);
`;

const CompetitorAnalysis = () => {
  const [username, setUsername] = useState("");
  const [channelData, setChannelData] = useState(null);
  const [videos, setVideos] = useState([]);
  const [keywordAnalysis, setKeywordAnalysis] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const fetchVideos = async () => {
    setLoading(true);
    setError(null);
    
    try {
      const videoResponse = await axios.post("http://localhost:5000/analyze", { username });
      setChannelData(videoResponse.data.channelData);
      setVideos(videoResponse.data.videos);
      setKeywordAnalysis(videoResponse.data.keywordAnalysis);
    } catch (err) {
      setError("Failed to fetch data. Check the username and API.");
    }
    
    setLoading(false);
  };

  return (
    <Container>
      <Header>Competitor Analysis</Header>
      <SearchBar
        type="text"
        placeholder="Enter Competitor's Channel Name"
        value={username}
        onChange={(e) => setUsername(e.target.value)}
      />
      <Button onClick={fetchVideos}>Get Videos</Button>

      {loading && <p>Loading...</p>}
      {error && <p style={{ color: "red", textAlign: "center" }}>{error}</p>}

      {channelData && (
        <div>
          <h2>{channelData.title}</h2>
          <p>Subscribers: {channelData.subscriberCount}</p>
        </div>
      )}

      <VideoList>
        {videos.map((video) => (
          <VideoItem key={video.videoId}>
            <a
              href={`https://www.youtube.com/watch?v=${video.videoId}`}
              target="_blank"
              rel="noopener noreferrer"
              style={{ fontWeight: "bold", textDecoration: "none", color: "#007aff" }}
            >
              {video.title}
            </a>
            <p>Views: {video.views} | Likes: {video.likes} | Comments: {video.comments}</p>
          </VideoItem>
        ))}
      </VideoList>

      {keywordAnalysis && (
        <KeywordSection>
          <h3>Keyword Analysis</h3>
          <p><strong>Top Keywords:</strong> {keywordAnalysis.keywords?.join(", ")}</p>
          <p><strong>Top Bigrams:</strong> {keywordAnalysis.bigrams?.join(", ")}</p>
          <p><strong>Top Trigrams:</strong> {keywordAnalysis.trigrams?.join(", ")}</p>
          <p><strong>TF-IDF Scores:</strong> {JSON.stringify(keywordAnalysis.tfidfScores)}</p>
          <p><strong>Sentiment Score:</strong> {keywordAnalysis.avgSentiment}</p>
        </KeywordSection>
      )}
    </Container>
  );
};

export default CompetitorAnalysis;
